import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import {Nav, Navbar, NavItem} from 'react-bootstrap'

export default class Navigation extends Component {
  render() {
    return (
      <Navbar expand="lg" bg="light" fixed="top">
        <Navbar.Brand><Link to="/">Alex Do</Link></Navbar.Brand>
          <Nav>
            <NavItem eventKey={1} componentClass={Link} to="/AboutMe.js">
              About Me
            </NavItem>
            <NavItem eventKey={2} componentClass={Link} to="/Software">
              Software
            </NavItem>
            <NavItem eventKey={3} componentClass={Link} to="/Music">
              Music
            </NavItem>
          </Nav>
      </Navbar>

    );
  }
}
